B.a0o=new A.f9("1. Aceita\xe7\xe3o dos Termos",null)
B.a03=new A.eQ("Ao criar uma conta ou usar o Par Crist\xe3o, voc\xea concorda em cumprir estes Termos de Uso. Se voc\xea n\xe3o concordar com qualquer parte destes termos, n\xe3o dever\xe1 usar nosso servi\xe7o.",null)
B.a0k=new A.f9("2. Elegibilidade",null)
B.a09=new A.eQ("Voc\xea deve ter pelo menos 18 anos de idade para usar este aplicativo. Ao usar o servi\xe7o, voc\xea declara e garante que tem o direito, autoridade e capacidade para celebrar este contrato.",null)
B.a0q=new A.f9("3. Conduta do Usu\xe1rio",null)
B.a0e=new A.eQ("Esperamos que todos os usu\xe1rios mantenham um comportamento respeitoso e crist\xe3o. \xc9 proibido:\n\u2022 Assediar ou intimidar outros usu\xe1rios.\n\u2022 Publicar conte\xfado ofensivo, obsceno ou ilegal.\n\u2022 Usar o servi\xe7o para fins comerciais n\xe3o autorizados.\n\u2022 Criar perfis falsos ou se passar por outra pessoa.",null)
B.a0i=new A.f9("4. Rescis\xe3o",null)
B.a02=new A.eQ("Reservamo-nos o direito de suspender ou encerrar sua conta a qualquer momento, sem aviso pr\xe9vio, se acreditarmos que voc\xea violou estes Termos.",null)
B.a0j=new A.f9("5. Isen\xe7\xe3o de Responsabilidade",null)
B.a0b=new A.eQ('O servi\xe7o \xe9 fornecido "como est\xe1". N\xe3o garantimos que o servi\xe7o ser\xe1 ininterrupto ou livre de erros.\n\nIMPORTANTE: N\xe3o nos responsabilizamos pela veracidade das informa\xe7\xf5es fornecidas por outros usu\xe1rios. N\xe3o realizamos verifica\xe7\xe3o de antecedentes criminais. Voc\xea \xe9 o \xfanico respons\xe1vel por suas intera\xe7\xf5es e deve ter cautela ao compartilhar informa\xe7\xf5es pessoais. N\xe3o nos responsabilizamos por qualquer engano, dano ou preju\xedzo decorrente de intera\xe7\xf5es com outros usu\xe1rios.',null)
B.a0w=new A.f9("6. Selo de Verifica\xe7\xe3o",null)
B.a07=new A.eQ("O selo de verifica\xe7\xe3o (\xedcone azul ao lado do nome) indica que o usu\xe1rio passou por um processo de verifica\xe7\xe3o de identidade atrav\xe9s de selfie com gesto.\n\nIMPORTANTE:\n\u2022 Apenas perfis com o selo de verifica\xe7\xe3o foram verificados.\n\u2022 Perfis SEM o selo n\xe3o passaram por verifica\xe7\xe3o de identidade.\n\u2022 A verifica\xe7\xe3o confirma apenas que a pessoa corresponde \xe0s fotos do perfil, N\xc3O garante car\xe1ter, inten\xe7\xf5es ou antecedentes.\n\u2022 Se um usu\xe1rio verificado alterar suas fotos, o selo \xe9 removido automaticamente e uma nova verifica\xe7\xe3o ser\xe1 necess\xe1ria.\n\nRecomendamos cautela adicional ao interagir com perfis n\xe3o verificados.",null)
B.U8=s([B.a0o,B.a03,B.a0k,B.a09,B.a0q,B.a0e,B.a0i,B.a02,B.a0j,B.a0b,B.a0w,B.a07],t.p)
