B.a0_=new A.eQ("Sua privacidade \xe9 muito importante para n\xf3s. Esta pol\xedtica descreve como coletamos, usamos e protegemos suas informa\xe7\xf5es pessoais.",null)
B.a0t=new A.f9("1. Informa\xe7\xf5es que Coletamos",null)
B.a06=new A.eQ("Coletamos informa\xe7\xf5es que voc\xea nos fornece diretamente, como:\n\u2022 Dados de cadastro (nome, e-mail, data de nascimento).\n\u2022 Informa\xe7\xf5es do perfil (fotos, bio, igreja, interesses).\n\u2022 Localiza\xe7\xe3o (para mostrar pessoas pr\xf3ximas).\n\nColetamos informa\xe7\xf5es sobre sua denomina\xe7\xe3o religiosa estritamente para conectar voc\xea com perfis compat\xedveis, conforme o objetivo do aplicativo.",null)
B.a0v=new A.f9("2. Como Usamos Seus Dados",null)
B.a0f=new A.eQ("Usamos suas informa\xe7\xf5es para:\n\u2022 Operar e melhorar o servi\xe7o.\n\u2022 Conectar voc\xea com outros usu\xe1rios compat\xedveis.\n\u2022 Enviar notifica\xe7\xf5es importantes.\n\u2022 Garantir a seguran\xe7a da comunidade.",null)
B.a0n=new A.f9("3. Compartilhamento de Informa\xe7\xf5es",null)
B.a04=new A.eQ("N\xe3o vendemos seus dados pessoais. Compartilhamos informa\xe7\xf5es apenas quando necess\xe1rio para operar o servi\xe7o (ex: provedores de infraestrutura) ou quando exigido por lei.",null)
B.a0u=new A.f9("4. Seguran\xe7a",null)
B.a0a=new A.eQ("Implementamos medidas de seguran\xe7a para proteger seus dados contra acesso n\xe3o autorizado. No entanto, nenhum sistema \xe9 100% seguro.",null)
B.a0p=new A.f9("5. Seus Direitos",null)
B.a0g=new A.eQ("Voc\xea pode acessar, corrigir ou excluir sua conta e seus dados a qualquer momento atrav\xe9s das configura\xe7\xf5es do aplicativo.",null)
B.a0h=new A.f9("6. Verifica\xe7\xe3o de Perfil",null)
B.a0c=new A.eQ("Oferecemos um sistema volunt\xe1rio de verifica\xe7\xe3o de identidade atrav\xe9s de selfie com gesto. Ao solicitar verifica\xe7\xe3o:\n\n\u2022 Voc\xea nos envia uma selfie realizando um gesto espec\xedfico.\n\u2022 Comparamos a selfie com as fotos do seu perfil.\n\u2022 Se aprovado, seu perfil recebe um selo de verifica\xe7\xe3o (\xedcone azul).\n\u2022 Se voc\xea alterar suas fotos ap\xf3s a verifica\xe7\xe3o, o selo \xe9 removido automaticamente.\n\nA selfie de verifica\xe7\xe3o \xe9 armazenada de forma segura e utilizada exclusivamente para fins de verifica\xe7\xe3o de identidade.",null)
